            font-style: normal;
            font-display: swap;
        }

        :root,
        .team-light {
            --primary-text: #13173E;
            --secondary-text: #6347F5;
        }

        body {
            font-family: 'JetBrains Mono', monospace;
            margin: 0;
            padding: 0;
        }

        h1#title {
            padding-top: 10px;
            padding-bottom: 10px;
            margin: 0;
            text-align: center;
            color: var(--primary-text);
        }

        .highcharts-dashboards-component-kpi-value {
            font-size: 4em;
            line-height: 2.4rem;
            margin: 0.5em 10px;
            color: var(--secondary-text);
        }
        .highcharts-dashboards-component-subtitle {
            margin: 0.5em 10px;
        }
        /* *** */
        #kpi-vitamin-a .highcharts-dashboards-component-kpi-subtitle,
        #kpi-iron .highcharts-dashboards-component-kpi-subtitle {
            margin-top: 10px;
            font-size: 1.2em;
            color: var(--highcharts-neutral-color-60);
        }

        #kpi-vitamin-a .highcharts-dashboards-component-kpi-value,
        #kpi-iron .highcharts-dashboards-component-kpi-value {
            font-size: 4em;
            line-height: 2.4rem;
            margin-top: 10px;
            color: var(--highcharts-color-0);
        }

        #kpi-iron .highcharts-dashboards-component-kpi-value {
            color: var(--highcharts-color-2);
        }

        #dashboard-col-1 .highcharts-color-0 {
            fill: var(--highcharts-color-2);
            stroke: var(--highcharts-color-2);
        }

        #kpi-vitamin-a .highcharts-dashboards-component-kpi-value::after,
        #kpi-iron .highcharts-dashboards-component-kpi-value::after {
            content: "micrograms";
            display: block;
            font-size: 1rem;
        }

        .highcharts-plot-line {
            stroke-dasharray: 2px;
            stroke: var(--highcharts-color-3);
        }

        .highcharts-plot-line-label {
            fill: var(--highcharts-color-3);
        }

        .highcharts-description {
            padding: 0 20px;
        }

        #dashboard-col-2 {
            height: 323px;
        }

        #kpi-vitamin-a,
        #kpi-iron {
            flex: 1 1 100%;
            height: 205px;
        }

        /* LARGE */
        @media (max-width: 1200px) {
            #dashboard-col-0,
            #dashboard-col-1 {
                flex: 1 1 35%;
            }

            #kpi-wrapper {
                flex: 1 1 30%;
            }

            #kpi-vitamin-a,
            #kpi-iron {
                flex: 1 1 100%;
            }
        }

        /* MEDIUM */
        @media (max-width: 992px) {
            #dashboard-col-0,
            #dashboard-col-1 {
                flex: 1 1 50%;
            }

            #kpi-wrapper {
                flex: 1 1 100%;
            }

            #kpi-vitamin-a,
            #kpi-iron {
                flex: 1 1 50%;
            }
        }

        /* SMALL */
        @media (max-width: 576px) {
            #dashboard-col-0,
            #dashboard-col-1 {
                flex: 1 1 100%;
            }

            #kpi-wrapper {
                flex: 1 1 100%;
            }

            #kpi-vitamin-a,
            #kpi-iron {
                flex: 1 1 50%;
            }
        }
    </style>
</head>
